import PropTypes from "prop-types";
import styles from "./01_top.css";

const Top = ({ className = "" }) => {
  return (
    <header className={[styles.subtractTwoContainer, className].join(" ")}>
      <div className={styles.subtractTwoContainerChild} />
      <div className={styles.rectangleParent}>
        <div className={styles.frameChild} />
        <a className={styles.a} href="#">水瀬いのりセッション会</a>
      </div>
      <div className={styles.infoLinkContainer}>
        <div className={styles.aboutParent}>
          <a className={styles.about} href="#about">about</a>
          <a className={styles.about} href="#information">information</a>
          <a className={styles.about} href="#archive">archive</a>
          <a className={styles.about} href="#link">
            <p className={styles.link1}>link</p>
          </a>
        </div>
      </div>
    </header>
  );
};

Top.propTypes = {
  className: PropTypes.string,
};

export default Top;
